import React from 'react';
// import './Footer.css';

const Footer = () => {
  return (
    <section className="footer">
      <img className="footer-logo" src={`${process.env.PUBLIC_URL}/vivian-source/logo.jpg`} alt="Logo" />
      <h2>Vivian's Garden</h2>
      <p>Vivian's Garden Homestay, Thôn Trán Voi, Phú Mãn, Quốc Oai, Hà Nội 10000</p>
      <div className="contact-info">
        <span>Điện thoại: 091351966</span>
        <span>&bull;</span>
        <span>Email: vudangquangtung@gmail.com</span>
      </div>
      <a href="https://www.facebook.com/viviangardenhomestay" target="_blank" rel="noopener noreferrer">
        <i className="fab fa-facebook fa-3x"></i>
      </a>
    </section>
  );
};

export default Footer;
